import React from "react";
import {Switch, Route} from 'react-router-dom';

import Login from "./pages/Login";
import CadastroAluno from "./pages/CadastroAluno";

export default () => {
    return (
        <Switch>
            <Route exact path="/">
                <Login/>

            </Route>
            <Route exact path="/cadastro">
                <CadastroAluno/>

            </Route>

        </Switch>

    );
}
